import React, { useState } from "react";
import StudentService from "../../service/StudentService";
import { Form } from "react-bootstrap";

const ReservationCheck = () => {
  const [studentId, setStudentId] = useState("");
  const [info, setInfo] = useState("");

  const handleChange = (event) => {
    setStudentId(event.target.value);
  };

  const getData = async () => {
    console.log(studentId);

    const students = await StudentService.getStudentById(studentId);
    const hesCode = students[0].hesCode.toString();
    console.log(hesCode);
    const response = await StudentService.validateHesCode(
      hesCode,
      "25856242442",
      "Ge2212690"
    );
    const split = response.toString().split("\n");
    setInfo(split);
  };

  const studentIdForm = (
    <div>
      <Form>
        <div className="mb-3">
          <label for="exampleInputEmail1" className="Form-label">
            Email address
          </label>
          <input
            type="text"
            id="studentId"
            name="studentId"
            placeholder="student ID"
            onChange={() => handleChange}
          ></input>
        </div>
        <div className="mb-3">
          <label for="exampleInputPassword1" className="Form-label">
            Password
          </label>
          <input
            type="password"
            className="Form-control"
            id="exampleInputPassword1"
          ></input>
        </div>
        <div className="mb-3 Form-check">
          <input
            type="checkbox"
            className="Form-check-input"
            id="exampleCheck1"
          ></input>
          <label className="Form-check-label" for="exampleCheck1">
            Check me out
          </label>
        </div>
        <button
          className="button m-2 p-2"
          value="Check Reservation"
          onClick={getData}
        >
          Check Reservation
        </button>
      </Form>
    </div>
  );

  /*  <input
      className="m-2"
      type="text"
      id="studentId"
      name="studentId"
      placeholder="student ID"
      onChange={() => handleChange}
    />
    <div
      className="button m-2 p-2"
      value="Check Reservation"
      onClick={getData}
    >
      Check Reservation
    </div>*/

  return (
    <div>
      <div>{studentIdForm}</div>
      <div>{info}</div>
    </div>
  );
};

export default ReservationCheck;
